import { StyleSheet } from 'react-native'

export default StyleSheet.create({
  container: {
    padding: 22
  },
  deleteButton: {
    marginTop: 10,
    padding: 10,
    backgroundColor: red,
    borderRadius: 5,
  },
  deleteButtonText: {
    color: 'white',
    textAlign: 'center',
  }
})
